import React, { Component } from "react";
import { Nav, NavItem, NavLink } from 'react';
import '../../../style/assets/css/main.css';
import slide01 from "../../../style/images/slide01.jpg"
import slide02 from "../../../style/images/slide01.jpg"
import slide03 from "../../../style/images/slide01.jpg"
import slide04 from "../../../style/images/slide01.jpg"
import slide05 from "../../../style/images/slide01.jpg"

export default class Home extends Component {
    render() {
        return (
            <div>
                <h1>Welcome to the homepage!</h1>
                <img src = {slide01} alt = "/"></img>
            </div>
        );
    }
}
